import './App.css';
import React from 'react';

class App extends React.Component {
  constructor(props) {
    super(props);



  }



  render() {
    return (
      <div>
        <p id='break-label'>Break Length</p>

        <button 
          type='button'
          id='break-decrement'
        >
          decrement
        </button>
        <button 
          type='button'
          id='break-increment'
        >
          increment
        </button>

        <p id='session-label'>Session Length</p>

        <button 
          type='button'
          id='session-decrement'
        >
          decrement
        </button>
        <button 
          type='button'
          id='session-increment'
        >
          increment
        </button>
      </div>
    );
  }
}

export default App;
